import React, { useState, useEffect } from 'react';

// Compact TrickInput component
const TrickInput = ({ onTrickChange, initialResult = null, contract = '', onChangeContract }) => {
  // State for selected trick button
  const [selectedTrick, setSelectedTrick] = useState(null);
  // State for required tricks (based on contract level)
  const [requiredTricks, setRequiredTricks] = useState(7);
  
  // Container styles - more compact
  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '8px',
    marginTop: '0',
    maxWidth: '100%',
    boxSizing: 'border-box',
    maxHeight: '350px', // Constrain height
    overflow: 'hidden'
  };
  
  // Required tricks banner style - smaller
  const requiredTricksStyle = {
    backgroundColor: '#f0f3f8',
    padding: '8px',
    borderRadius: '6px',
    textAlign: 'center',
    fontSize: '14px',
    fontWeight: 'bold',
    color: '#2c3e50',
    border: '1px solid #dfe6e9',
    marginBottom: '4px'
  };
  
  // Tricks grid style - tighter spacing
  const gridStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '4px'
  };
  
  // Tricks row style - tighter spacing
  const rowStyle = {
    display: 'flex',
    gap: '4px'
  };
  
  // Change contract button style - smaller
  const changeButtonStyle = {
    width: '100%',
    height: '38px',
    marginTop: '8px',
    border: '1px solid #ddd',
    borderRadius: '6px',
    backgroundColor: '#f5f5f5',
    color: '#2c3e50',
    fontSize: '14px',
    fontWeight: 'bold',
    cursor: 'pointer'
  };
  
  // Calculate required tricks when contract changes
  useEffect(() => {
    if (contract) {
      const contractMatch = contract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
      if (contractMatch) {
        const level = parseInt(contractMatch[1]);
        setRequiredTricks(level + 6);
      }
    }
  }, [contract]);
  
  // Set selected trick from initialResult if provided
  useEffect(() => {
    if (initialResult !== null && requiredTricks) {
      // Calculate actual tricks from result
      const actualTricks = requiredTricks + initialResult;
      setSelectedTrick(actualTricks);
    }
  }, [initialResult, requiredTricks]);
  
  // Handle trick button click
  const handleTrickClick = (numTricks) => {
    setSelectedTrick(numTricks);
    
    // Calculate result based on tricks and required tricks
    const result = numTricks - requiredTricks;
    onTrickChange(result, numTricks);
  };
  
  // Function to get trick button style based on state - smaller buttons
  const getTrickButtonStyle = (trickNum) => {
    const isSelected = selectedTrick === trickNum;
    const isExact = trickNum === requiredTricks;
    const isMade = trickNum > requiredTricks;
    const isDown = trickNum < requiredTricks;
    
    let backgroundColor, borderColor, textColor;
    
    if (isSelected) {
      if (isExact) {
        backgroundColor = '#ff9800';
        borderColor = '#ff9800';
      } else if (isMade) {
        backgroundColor = '#4caf50';
        borderColor = '#4caf50';
      } else {
        backgroundColor = '#f44336';
        borderColor = '#f44336';
      }
      textColor = 'white';
    } else {
      if (isExact) {
        backgroundColor = '#fff3e0';
        borderColor = '#ffe0b2';
      } else if (isMade) {
        backgroundColor = '#e8f5e9';
        borderColor = '#c8e6c9';
      } else {
        backgroundColor = '#ffebee';
        borderColor = '#ffcdd2';
      }
      textColor = 'black';
    }
    
    return {
      flex: '1',
      height: '42px', // Reduced height
      minWidth: '40px', // Reduced width
      border: `1px solid ${borderColor}`,
      borderRadius: '6px',
      fontSize: '16px', // Reduced font size
      fontWeight: 'bold',
      cursor: 'pointer',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: backgroundColor,
      color: textColor,
      boxShadow: '0 1px 2px rgba(0,0,0,0.1)' // Reduced shadow
    };
  };
  
  // Handle change contract button click
  const handleChangeContract = () => {
    if (onChangeContract && typeof onChangeContract === 'function') {
      onChangeContract();
    }
  };
  
  // Generate trick buttons in rows of 4
  const renderTrickButtons = () => {
    const rows = [];
    
    for (let row = 0; row < 4; row++) {
      const tricks = [];
      for (let col = 0; col < 4; col++) {
        const trickNum = row * 4 + col;
        if (trickNum <= 13) {
          tricks.push(
            <button
              key={`trick-${trickNum}`}
              style={getTrickButtonStyle(trickNum)}
              onClick={() => handleTrickClick(trickNum)}
            >
              {trickNum}
            </button>
          );
        }
      }
      rows.push(
        <div key={`row-${row}`} style={rowStyle}>
          {tricks}
        </div>
      );
    }
    
    return rows;
  };
  
  return (
    <div style={containerStyle}>
      <div style={requiredTricksStyle}>
        Required tricks: {requiredTricks}
      </div>
      
      <div style={gridStyle}>
        {renderTrickButtons()}
      </div>
      
      <button 
        style={changeButtonStyle}
        onClick={handleChangeContract}
      >
        Change Contract
      </button>
    </div>
  );
};

export default TrickInput;
